module.exports = a = async ({ params }) => {
	function findValue(obj, matchString) {
		if (!obj || !Array.isArray(obj.credentialsDataList)) {
			return null; // Return null if object or credentialsDataList is invalid
		}

		// Find the element in credentialsDataList where type equals "Company Credential"
		const companyCredential = obj.credentialsDataList.find(item => item.type === "Company Credential");

		if (!companyCredential || !Array.isArray(companyCredential.data)) {
			return null; // Return null if no "Company Credential" or data array is invalid
		}

		// Find the object in the data array where key equals "unique_identifier"
		const uniqueIdentifierObj = companyCredential.data.find(item => item.key === matchString);

		// Return the value attribute of the found object, or null if not found
		return uniqueIdentifierObj ? uniqueIdentifierObj.value : null;
	}

	const id = findValue(params.sessionData, "unique_identifier");
	const selfie = findValue(params.sessionData, "selfie");

	return { id, selfie }
}

